import types from 'prop-types';
import React from 'react';
import {SectionTitle} from './components/SectionTitle'


// Components

import { ContentContainer } from '../../../../components/ContentContainer';

// Styles

import './styles.scss';
import { dataFirstProject, dataSecondProject } from './data';



export const SectionWhatWeDo = props => {
    // Render

    return (
      <section className="about">
        <ContentContainer maxWidth="1600">
          <div className="about__content">
            <SectionTitle 
            className="about__title"
            fluidWidth
            color="secondary"
            title="What We Do"/>
          </div>
          <FirstProject dataFirstProject={dataFirstProject}/>

        </ContentContainer>
      </section>
    );
}

  // ----------------

  // Type of props

  SectionWhatWeDo.propTypes = {
    prop: types.string,
  };

  // Default value for props

  SectionWhatWeDo.defaultProps = {};
